import React from 'react';
import './CalendarHome.css';
import { BrowserRouter as Router, Route, Routes, Link} from "react-router-dom";
import MeetingStatus from '../MeetingStatus/meetingStatus';
function CalendarHome() {

    return (
      <Router>
      <div className="navigation">
      <ul>
      <li><a href="default.asp">Logout</a></li>
      <li><a href="news.asp">Account</a></li>
      <li><a href="contact.asp">Schedule</a></li>
      <h2 className="left">CALENDAR</h2>
      </ul>
      </div>
      <div className="content">
        <button>Meeting Setup</button>
        <Link to="/meeting-status"><button>Meeting Status</button></Link>
        <button>Confrim Attendance</button>
      </div>
      <div className="footer">
      <ul>
      <li><a href="default.asp">Contact us</a></li>
      <li><a href="news.asp">Help</a></li>
      </ul>
      </div>
      <Routes>
        <Route path="/meeting-status" component={<MeetingStatus />} />
            </Routes>
      </Router>
    );
  }

  export default CalendarHome;
